import React from 'react';
import Footer from './Footer';
import './Homepage.module.css'; // Import your CSS file

const Homepage = () => {
  return (
    <div className="home-container">
      <header className="home-header">
        <h1 className="welcome-title">Welcome to the Address Management System</h1>
        <h1 className="welcome-title-2">Welcome to the Address Management System</h1>

        <p className="pen">Organize and manage your addresses with ease.</p>
        <p>Start managing your addresses today. Click the button below to access your address book.</p>
        <button className="home-button">Go to Address Book</button>
      </header>

      <main className="home-main">
        <h2>Get Started</h2>
        {/* Your main content here */}
      </main>

      <Footer />
    </div>
  );
};

export default Homepage;
